import imgProduct01 from "../../images/image-product-1.jpg";

const Modal = () => {
  return (
    <div className="modal flex items-center justify-center absolute inset-0 bg-black ">
      <div className="w-3/12 h-3/12">
        <img src={imgProduct01} alt="product-image" />
      </div>
    </div>
  );
};

export default Modal;
